import React from 'react';
import loginImage from './resources/images/login.png';

function Test() {
    return (
        <div className="container-fluid">
            <div className="row">
                <div className='col-7' style={{backgroundImage: `url($(loginImage))` ,height: '100vh' }}>
                    Hello
                </div>
                <div className='col-5 bg-secondary' style={{ height: '100vh' }}>
                    Hello
                </div>
            </div>
        </div>
    );  
}

export default Test;
